import React, { Component } from 'react';

const hundred = '100';



class App extends Component {

  console() {
    console.log('Hey')
  }
  render() {
    return(
      <div>
        <p>Hi</p>
        <p>{hundred}</p>
        <button type="button" onClick={this.console}>Click</button>
      </div>
    );
  }
}

export default App;
